import React from "react";
import "./Types.css";

const Types = () => {
  const array2 = [
    {
      name: "Hotels",
      count: 233,
      image: "./images/type_1.webp",
    },
    {
      name: "Apartments",
      count: 2331,
      image: "./images/type_2.jpg",
    },
    {
      name: "Resorts",
      count: 2331,
      image: "./images/type_3.jpg",
    },
    {
      name: "Villas",
      count: 2331,
      image: "./images/type_4.jpg",
    },
    {
      name: "Cabins",
      count: 2331,
      image: "./images/type_5.jpg",
    },
  ];

  return (
    <div className="conten2a">
      <h2 className="conten2b">Browse by property type</h2>
      <div className="conten2c">
        {array2.map((array2, index) => (
          <div className="conten2d">
            <img className="conten2e" src={array2.image} alt={array2.index} />
            <h3 className="conten2f">{array2.name}</h3>
            <h3 className="conten2h">{array2.count}</h3>
          </div>
        ))}
      </div>
    </div>
  );
};
export default Types;
